import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

function Expenses(props) {
  return (
    <div className="expenses">
      <ExpenseItem
        title={props.ArrayExpense[0].title}
        amount={props.ArrayExpense[0].amount}
        date={props.ArrayExpense[0].date}
      ></ExpenseItem>
    </div>
  );
}

export default Expenses;
